script: |
  super -f text -I q7205.spq | sort > q7205.out

inputs:
  - name: q7205.spq
    data: |
      SELECT col1 AS col0 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT - col2 * col0 NOT IN ( col2 ) OR NULL BETWEEN + col1 * - col0 * + col0 AND + col2;
  - name: tab0

outputs:
  - name: q7205.out
    data: |
